import classes from "./MainHeader.module.css"

const MainHeader =()=>{


    return(
        <header className={classes.header}>
            <nav>

                <ul>
                    <li>
                        <NavLink href="/welcome">Welcome</NavLink>
                    </li>
                    <li>
                        <NavLink href="/products">Products</NavLink>
                    </li>
                </ul>
            </nav>
        </header>
    )
}

export default MainHeader;
